import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

import Header from "../_includes/header/Header";
import Drawer from "../_includes/drawer/Drawer";
import Content from "../_includes/content/Content";
import Footer from "../_includes/footer/Footer";

const useStyles = makeStyles(theme => ({
    root: {
        display: 'flex',
    },
    wrapper: {
        display: 'flex',
        height: '100vh',
        flexDirection: 'column',
        flexGrow: 1,
    },
}));


export default function Layout(props) {
    const classes = useStyles();

    return (
        <div className={classes.root}>

            <Header title='compositions' />

            <Drawer />

            <div className={classes.wrapper}>
                <Content inner={props.children} />
                <Footer />
            </div>
        </div>
    );
}
